class Submission:
    def __init__(self, user_id, data):
        self.user_id = user_id
        self.data = data
        self.status = "Pending"

    def validate(self):
        # Basic validation logic, extend as needed
        if not self.data:
            raise ValueError("Data cannot be empty")
        if len(self.data) < 5:
            raise ValueError("Data must be at least 5 characters long")
        self.status = "Valid"
        return True


class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.cache = {}

    def submit(self, user_id, data):
        submission = Submission(user_id, data)
        if submission.validate():
            self.submissions.append(submission)
            self.cache[submission.user_id] = submission
            return submission
        return None

    def get_all_submissions(self):
        return self.submissions

    def cache_submission(self, submission):
        self.cache[submission.user_id] = submission

    def get_cached_submission(self, user_id):
        return self.cache.get(user_id)


class ValidationRules:
    def __init__(self):
        self.rules = []

    def add_rule(self, rule):
        self.rules.append(rule)

    def validate_data(self, data):
        for rule in self.rules:
            if not rule(data):
                return False
        return True


