class BrokerUser:
    def __init__(self, submission_manager):
        self.submission_manager = submission_manager

    def validate_upload(self, user_id, data):
        submission = Submission(user_id, data)
        try:
            return submission.validate()
        except ValueError as e:
            print(f"Validation failed: {e}")
            return False

    def sync_data_source(self, data_source):
        data_sync = DataSync(data_source)
        data_sync.sync_data()


